import React from "react";
import { useState } from "react";
function Todo(props) {
  function deleteHandler() {
    //alert("deleted");
    console.log(props.text);
  }

  return (
    <div className="card">
      <h2> {props.text} </h2>
      <div className="actions">
        <button className="btn" onClick={deleteHandler}>
          Delete
        </button>
      </div>
    </div>
  );
}

export default Todo;
